import MyButton from "../components/MyButton";
import MyHeader from "../components/MyHeader";

import { useState } from "react";

const Home = () => {

    const [curDate, setCurDate] = useState(new Date());

    const headText = `${curDate.getFullYear()}년 ${curDate.getMonth()+1}월`;

    return(
        <div>
        <MyHeader leftChild={<MyButton text={"<"}></MyButton>} headText={headText} rightChild={<MyButton text={">"}></MyButton>}></MyHeader>
        <select>
            <option value="1" selected={true}>최신순</option>
            <option value="2">시간순</option>
        </select>
        <select>
            <option value="1" selected={true}>전부다</option>
            <option value="2">좋은 감정</option>
            <option value="2">안 좋은 감정</option>
        </select>
        <select defaultValue={"전부 다"}></select>
        <MyButton text={"새 일기 쓰기"} type={"positive"}></MyButton>
        </div>
    )
}

export default Home;
